import data from "./data"




function App() {
    const [notes ,setNotes] = useState(data)



const addnewNotes =premeter => {
        const newNotes = {
            id: Date.now(),
            title: premeter.title,
            body: premeter.body,
        }
        setNotes(...notes,newNotes)

}



  return (
    <div className="App">
<h1>my notes </h1>
        <Page addnewNotes={addnewNotes}/>
        <PageTwo notes = {notes}/>
    </div>
  );
}

export default App;
